    max-width:1200px;
    margin:0 auto;
`;

const Sns = memo(() => {
  return (
    <SnsContainer>
        <div className='SNSWrap'>
        <h3 className='title'>PAIK’S COFFEE SNS</h3>
            <p className='content'>#빽다방#빽다방신메뉴#빽다방이벤트</p>
            <hr className='divider' />
        </div>
    </SnsContainer>
  );
});

export default Sns;
